import React from 'react';
import {View, Text, StyleSheet} from "react-native";

const FlexboxScreen= () =>{
    return(
       <View style={{backgroundColor:"#2f363f", flex:1}}>
           <View style={{backgroundColor:"#2f363f", width:100, height:100}}> </View>
           <View style={{backgroundColor:"#2f363f", width:100, height:100}}> </View>
           <View style={{backgroundColor:"#2f363f", width:100, beight:100}}> </View>
       </View>
    );
};
